INSERT INTO `job_profiles_jobprofile` VALUES (1,'Innendienst','Herr Mller ist Sachbearbeiter im Innendienst im Vertrieb & Marketing. Er arbeitet berwiegend am stationren PC und ihat viel telefonischen Kontakt zu Kunden.','	Arbeit im Projekt Smarte Ventilatoren, in dem er in Kontakt mit verschiedenen Projektpartnern wie externen Dienstleister (u.a. TechNik GmbH) und Stammlieferanten steht \r\n	Erstellung von Angeboten und Auftragsbesttigungen \r\n	Verwaltung ausgewhlter Stammkunden \r\n	Er arbeitet berwiegend mit einem ERP-System, Office-Anwendungen, E-Mail-Programm, Kollaborationssystemen, Cloud-Speicher und verfgt ber einen internen Unternehmensaccount fr einen Instant-Messenger',1),(3,'Geschftsfhrer*in','Frau Arneo ist Geschftsfhrerin der Arneo GmbH und trgt die Gesamtverantwortung fr die strategische Ausrichtung und das operative Management des Unternehmens. Sie ist eine erfahrene Unternehmenslenkerin, die die Vision, die Ziele und die Strategie des Unternehmens definiert und umsetzt, um nachhaltiges Wachstum und Erfolg zu gewhrleisten.','	Festlegung von Unternehmensvision, -zielen und -strategie\r\n	Gesamtverantwortung fr operatives Management, inklusive Risikomanagement\r\n	Fhrung und Motivation von Fhrungskrften und Mitarbeitern\r\n	berwachung der Unternehmensperformance und Innovationsmanagement',1),(4,'Fhrungskraft','Frau Blitz ist eine Fhrungskraft und trgt die Verantwortung fr die strategische Planung, Organisation und Leitung von Teams oder Abteilungen innerhalb des Unternehmens. Sie ist eine erfahrene Entscheidungstrgerin, der in der Lage ist, Mitarbeiter*innen zu motivieren und zu fhren, um Unternehmensziele zu erreichen.','	Strategische Planung und Umsetzung von Unternehmenszielen\r\n	Organisatorische Leitung von Teams oder Abteilungen\r\n	Motivation, Fhrung und Entwicklung von Mitarbeitern\r\n	Entscheidungsfindung und Risikomanagement\r\n	Aufbau und Pflege von Beziehungen zu internen und externen Stakeholdern\r\n	Budgetverantwortung und Ressourcenmanagement',1),(6,'IT-Admin','Herr Laimer ist IT-Admin. Er ist verantwortlich fr die Administration, berwachung und Wartung der IT-Infrastruktur des Unternehmens. Mit seinen umfassenden IT-Kenntnissen und Erfahrungen stellt er sicher, dass alle IT-Systeme und Netzwerke reibungslos funktionieren und den Sicherheitsrichtlinien entsprechen.','	Administration, berwachung und Wartung der IT-Infrastruktur\r\n	Sicherstellung des reibungslosen Betriebs von IT-Systemen und Netzwerken\r\n	Umsetzung von Sicherheitsrichtlinien und Schutz vor Cyberbedrohungen\r\n	Untersttzung von Mitarbeitern bei IT-Fragen und Problemen',1),(7,'Auendienst','Herr Schmidt ist Sachbearbeiter im Auendienst im Vertrieb & Marketing. Er ist viel unterwegs und arbeitet auch hufiger im Ausland. Damit hat er ein hohes Risiko fr Fremdeinfluss.','	Arbeit im Projekt Smarte Ventilatoren, in dem er hier die neuen smarten Ventilatoren auf Messen prsentiert und Kunden dazu akquiriert\r\n	Des Weiteren ist er fr Betreuung und Beratung weiterer Stammkunden der Arneo GmbH zustndig und \r\n	Analysiert dafr stets neue Verkaufsgebiete und Ermitteln neuer Absatzmglichkeiten	\r\n	Dabei arbeitet er berwiegend von unterwegs und besitzt einen Laptop, auf dem er die allgemeinen Office-Anwendungen und ein E-Mail-Programm nutzt, sowie ein dienstliches Smartphone mit einem Unternehmensaccount fr einen internen Instant-Messenger',1);
