INSERT INTO `threats_threatarea` VALUES (1,'Kollaborationssysteme','Software oder Plattformen, die die Zusammenarbeit und Kommunikation in einer Organisation untersttzen.'),(2,'Social Media Systeme','Online-Plattformen, die Benutzern ermglichen, Inhalte zu teilen, zu kommunizieren und zu interagieren'),(3,'Mailsystem','Ein System zum Senden, Empfangen und Verwalten von E-Mails.'),(4,'Instantmessenger','Eine Softwareanwendung, die Echtzeitkommunikation ber das Internet ermglicht.'),(5,'USB-Stick','Ein tragbares Speichergert, das an einen Computer angeschlossen werden kann, um Daten zu bertragen oder zu speichern.'),(6,'Laptop','Ein tragbarer Computer, der hnliche Funktionen wie ein Desktop-PC bietet.'),(8,'Internes Informationssystem','Ein System, das von einer Organisation intern genutzt wird, um Daten zu verwalten und zu teilen.'),(9,'Server','Ein Computer oder ein Computersystem, der/das Dienste oder Ressourcen fr andere Computer bereitstellt.'),(11,'PC','Ein PC ist ein individueller Computerarbeitsplatz, der fr die tglichen Arbeitsaufgaben von Mitarbeitern verwendet wird und eine Vielzahl von Softwareanwendungen ausfhrt.'),(14,'Online-Banking','Online-Banking bezeichnet die elektronische Abwicklung von Bankgeschften ber das Internet, bei der Kunden Finanztransaktionen wie berweisungen, Kontostandsabfragen oder Wertpapierhandel bequem ber eine Website oder mobile App durchfhren knnen.'),(15,'Online-Shop','Eine eine digitale Verkaufsplattform im Internet, auf der Produkte oder Dienstleistungen angeboten und von Kunden ber eine Website oder App erworben werden knnen.'),(16,'Mitarbeiter','Personen, die in einer Organisation arbeiten und Zugriff auf Informationen haben.'),(17,'Sensible Informationen','Daten, die vertraulich oder geschtzt sind, wie persnliche Identifikationsinformationen, finanzielle Daten oder geistiges Eigentum.'),(18,'Netzwerk','Ein System von verbundenen Gerten, das Daten austauscht.'),(19,'Internet Browser','Eine Softwareanwendung, die verwendet wird, um Zugang zum Internet zu erhalten und Webseiten anzuzeigen.'),(20,'Telefon','Ein Kommunikationsgert, das fr Sprachanrufe, Textnachrichten und mglicherweise auch Internetzugang verwendet wird.'),(21,'Buchhaltungssystem','in Buchhaltungssystem ist eine Software, die Geschftstransaktionen erfasst, Finanzberichte generiert und die Verwaltung von Einnahmen und Ausgaben erleichtert.'),(22,'Smartphone','Mobiltelefon mit Touchscreen und zustzlichen Funktionen wie GPS und der Mglichkeit, Apps darauf zu installieren');
