INSERT INTO `threats_threatevent` VALUES (1,'Durchfhrung von Social Engineering auf der Basis von Outsider/Insider, um Informationen zu erhalten','Der Angreifer unternimmt Aktionen (z. B. per E-Mail oder Telefon) mit der Absicht, Personen innerhalb von Organisationen zu berreden oder auf andere Weise dazu zu bringen, kritische/sensible Informationen (z. B. personenbezogene Daten) preiszugeben.'),(2,'(Speer)-Phishing','Der Angreifer flscht Mitteilungen einer legitimen/vertrauenswrdigen Quelle, um an vertrauliche Informationen wie Benutzernamen oder Kennwrter oder zu gelangen. Typische Angriffe erfolgen per E-Mail, Instant Messaging oder auf vergleichbare Weise; dabei werden die Benutzer in der Regel auf scheinbar legitime Websites geleitet, whrend die eingegebenen Informationen in Wirklichkeit gestohlen werden. Der Angreifer setzt u. U. Phishing-Angriffe ein, die auf hochrangige Ziele abzielen (z. B. leitende Angestellte/Fhrungskrfte).'),(3,'Einschleusen bekannter Malware in interne Informationssysteme der Organisation','Der Angreifer nutzt gngige bermittlungsmechanismen (z. B. E-Mail), um Malware in Informationssysteme von Unternehmen zu installieren/einzuschleusen.'),(4,'Kompromittierung von Informationssystemen','Hierbei nutzt der Angreifer gngige bermittlungsmechanismen wie E-Mails, um Malware in die Informationssysteme von Unternehmen einzufhren und zu installieren.'),(5,'Web Defacement','Der Angreifer macht unautorisierte nderungen an ffentlichen Webseiten.'),(6,'Man-in-the-Middle-Attack','Der Angreifer fngt Nachrichten des Opfers ab und sendet sie an ihr Ziel weiter, um so unbemerkt die Kommunikation zu kompromittieren.'),(7,'Verbreitung von Malware durch Bereitstellung von Wechselmedien','Der Angreifer verteilt Wechseldatenspeicher mit Malware, die das Opfer an eigenen Gerten nutzt.'),(10,'Durchfhrung von nicht zielgerichteten Zero-Day-Angriffen','Der Angreifer setzt Angriffe ein, die noch nicht verffentlichte Schwachstellen ausnutzen. Die Angriffe basieren nicht auf den Erkenntnissen des Angreifers ber spezifische Schwachstellen von Organisationen.'),(11,'Malware ber downloadbare Software','Der Angreifer korrumpiert Freeware, Shareware oder kommerzielle IT-Produkte oder fgt Malware in diese ein. Der Angreifer zielt nicht spezifische Organisationen, und sucht nach Eintrittspunkten in interne organisatorische IS. Diese Bedrohung ist besonders fr Handy-Applikationen relevant.'),(12,'Ausnutzen schlecht konfigurierter Systeme','Der Angreifer erlangt durch das Internet Zugang zu IS, die nicht fr die Konnektivitt zum Internet autorisiert sind oder organisatorische Vorgaben nicht erfllen.'),(13,'Pharming-Angriff','Pharming ist eine Art von Phishing, bei der der Angreifer Nutzer zu bsartigen Seiten oder Proxy-Servern leitet, typescherweise mittels Domain Name System (DNS)-Poisoning.'),(14,'Shopping-/Service-Betrug','Der Angreifer verkauft nicht existierende Produkte oder Services.'),(15,'Falscher Umgang mit kritischen und/oder sensiblen Informationen','Diese Art von Bedrohung kann verschiedene Formen annehmen. Ein Mitarbeiter knnte versehentlich sensible Daten an falsche Empfnger senden, beispielsweise durch einen Fehler bei der Adressierung einer E-Mail oder durch die Auswahl eines falschen Empfngers in einer Datenbank. Eine andere Mglichkeit ist der mutwillige Diebstahl oder die Weitergabe vertraulicher Informationen durch einen Mitarbeiter, sei es aus finanziellen Motiven, Rache, Nachlssigkeit oder Unwissenheit ber die Bedeutung der Daten.'),(16,'Ausnutzung von Schwachstellen in internen Informationssystemen der Organisation','Der Angreifer sucht nach bekannten Schwachstellen in den internen Informationssystemen des Unternehmens und nutzt diese Schwachstellen aus.'),(17,'Durchfhrung von Brute-Force-Anmeldeversuchen/Passworterratungsangriffen','Der Angreifer versucht, sich durch zuflliges oder systematisches Erraten von Passwrtern Zugang zu den Informationssystemen eines Unternehmens zu verschaffen, mglicherweise mit Hilfe von Programmen zum Knacken von Passwrtern.'),(18,'Durchfhrung von Data Scavenging-Angriffen in einer Cloud-Umgebung','Der Angreifer erlangt Daten, die von organisatorischen Prozessen in einer Cloud-Umgebung verwendet und dann gelscht werden.'),(20,'Angriffe auf persnliche Gerte kritischer Mitarbeiter*innen / Kompromittierung','Der Angreifer zielt auf wichtige Mitarbeiter des Unternehmens ab, indem er Malware auf deren persnliche Computern platziert. Ziel ist es, alle Flle auszunutzen, in denen Mitarbeiter persnliche Informationssysteme oder -gerte fr den Umgang mit kritischen/sensiblen Informationen nutzen.'),(21,'Durchfhrung von Network-Sniffing an freien Netzwerken','Ein Angreifer, der Zugang zu ungeschtzten drahtgebundenen oder drahtlosen Datenkanlen hat, die zur bertragung von Informationen verwendet werden, nutzt Netzwerk-Sniffing, um Komponenten, Ressourcen und Schutzmanahmen zu identifizieren.'),(22,'Installation von Allzweck-/persistenten/gezielten Sniffern in organisationsgesteuerten Informationssystemen oder Netzwerken','Der Angreifer installiert eine Sniffersoftware auf internen Informationssystemen oder Netzwerken der Organisation oder Netzwerke.'),(23,'Erfassen sensibler Informationen durch Netzwerk-Sniffing externer Netzwerke','Der Angreifer erhlt Zugriff auf ungeschtzte drahtgebundene oder drahtlose Datenkanle, die Organisationen (oder Organisationspersonal) zur bertragung von Informationen nutzen (z. B. Kioske, ffentliche drahtlose Netzwerke) und fngt diese Kommunikation ab.'),(24,'Kompromittierung von Informationssystem-Sitzungen des Datenverkehrs zwischen der Organisation und externen Entitten','Der Angreifer bernimmt die Kontrolle ber bereits bestehende, legitime Informationssystemsitzungen zwischen Organisationen und externen Stellen.'),(25,'Durchfhrung einfacher/verteilter/gezielter Denial-of-Service-Angriffe (DoS)','Ein Angreifer versucht, eine ber das Internet zugngliche Ressource fr die beabsichtigten Benutzer unzugnglich zu machen oder zu verhindern, dass die Ressource effizient oder berhaupt funktioniert, vorbergehend oder auf unbestimmte Zeit.'),(26,'Kompromittierung von Informationssystemen oder Gerten, die extern verwendet und wieder in das Unternehmen eingeschleust werden','Der Angreifer installiert Malware auf Informationssystemen oder Gerten, whrend sich diese Systeme/Gerte auerhalb des Unternehmens befinden, um anschlieend das Unternehmen zu infizieren, wenn es wieder angeschlossen ist.'),(28,'Autorisiertem Personal folgen, um Zutritt zu verschiedenen Einrichtungen zu erhalten (Tailgating)','Tailgating beschreibt im Sicherheitskontext das unbefugte Betreten geschtzter Bereiche, indem eine Person autorisiertem Personal physisch folgt, ohne selbst ordnungsgem Zugang gewhrt bekommen zu haben. Dabei nutzt der Angreifer die Gutglubigkeit oder Unaufmerksamkeit der befugten Person, um Zutritt zu sensiblen Einrichtungen zu erlangen.'),(29,'Ausnutzen bekannter Schwachstellen in mobilen Systemen (z. B. Laptops, PDAs, Smartphones)','Der Angreifer macht sich die Tatsache zunutze, dass sich Smartphones auerhalb des physischen Schutzes von Organisationen und des logischen Schutzes von Unternehmensfirewalls befinden, und kompromittiert die Smartphones auf der Grundlage bekannter Schwachstellen, um Informationen aus diesen Systemen zu sammeln.'),(30,'Ungesperrte Bildschirme','Ungesperrte Bildschirme beziehen sich auf Gerte wie Computer, Smartphones oder Tablets, deren Bildschirmsperre nicht aktiviert wurde, sodass sie ohne zustzliche Authentifizierung frei zugnglich sind. Dies stellt ein Sicherheitsrisiko dar, da Unbefugte ohne Hindernis auf sensible Informationen und Funktionen zugreifen knnen.'),(31,'(Weit verbreiteter) Festplattenfehler','Beschdigung des Speichers aufgrund eines Festplattenfehlers/Mehrere Festplattenfehler aufgrund der Alterung einer Reihe von Gerten, die alle zur gleichen Zeit vom gleichen Anbieter erworben wurden'),(32,'Spoofing','Der Angreifer erstellt Duplikate von legitimen Websites, wenn Benutzer eine geflschte\r\nWebsite besuchen, kann diese Informationen sammeln oder Malware herunterladen.'),(34,'Weitergabe sensibler Informationen','Ein autorisierter Mitarbeiter kontaminiert irrtmlich ein Gert, ein Informationssystem oder ein Netzwerk, indem Informationen mit einer Geheimhaltungsstufe/Sensibilitt darauf ablegt oder daran gesendet werden, zu deren Handhabung es nicht autorisiert wurde. Die Informationen sind dem Zugriff Unbefugter ausgesetzt, und das Gert, System oder Netzwerk ist nicht verfgbar, whrend der Schaden untersucht und behoben wird'),(35,'Bereitstellung von Malware','Der Angreifer nutzt komplexere bermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum bermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(36,'Einschleusen modifizierter Malware in interne Informationssysteme der Organisation','Der Angreifer nutzt komplexere bermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum bermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(37,'Bereitstellung gezielter Schadsoftware zur Kontrolle interner Systeme und zur Exfiltration von Daten','Der Angreifer installiert Malware, die speziell darauf ausgelegt ist, die Kontrolle ber die internen Informationssysteme eines Unternehmens zu bernehmen, vertrauliche Informationen zu identifizieren und diese Informationen zu exfiltrieren.'),(38,'Umfassende Laufwerksfehler','Beschdigung bzw. beralterung einer Reihe von Laufwerken, die alle zur gleichen Zeit vom gleichen Anbieter erworben wurden.'),(39,'Unzureichende Zugangskontrolle','Schleusen Sie autorisierte Mitarbeiter ein, um Zugang zu den Einrichtungen der Organisation zu erhalten.'),(41,'Falsche Berechtigungseinstellungen','Ein autorisierter Benutzer oder Administrator weist einem Benutzer flschlicherweise auergewhnliche Berechtigungen zu oder setzt die Berechtigungsanforderungen fr eine Ressource zu niedrig an.'),(42,'Bereitstellung (modifizierter) Malware fr interne Informationssysteme der Organisation','Der Angreifer nutzt ausgefeiltere bermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), um Malware und mglicherweise Modifikationen bekannter Malware zu bermitteln, um sich Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(43,'Ausnutzung von Schwachstellen durch Zero-Day-Angriffe','Der Angreifer fhrt Angriffe durch, die noch nicht verffentlichte Schwachstellen ausnutzen. Zero-Day-Angriffe basieren auf der Einsicht des Angreifers in die von Unternehmen genutzten Informationssysteme und Anwendungen sowie auf der Erkundung von Unternehmen durch den Angreifer.');
