INSERT INTO `threats_threatvector` VALUES (1,1,1,'Der Angreifer benutzt Kollaborationssysteme (z. B. Asana, Teams) mit der Absicht, Personen innerhalb von Organisationen zu berreden oder auf andere Weise dazu zu bringen, kritische/sensible Informationen (z. B. personenbezogene Daten) preiszugeben.'),(2,2,1,'Der Angreifer benutzt Social-Media-Systeme (z.B. Facebook, Twitter) mit der Absicht, Personen innerhalb von Organisationen zu berreden oder auf andere Weise dazu zu bringen, kritische/sensible Informationen (z. B. personenbezogene Daten) preiszugeben.'),(3,3,2,'Der Angreifer flscht E-Mails, um an vertrauliche Informationen wie Benutzernamen oder Kennwrter zu gelangen. Die Benutzer werden in der Regel auf scheinbar legitime Webseiten geleitet, whrend die eingegebenen Informationen in Wirklichkeit gestohlen werden. Der Angreifer setzt u. U. Phishing-Angriffe ein, die auf hochrangige Ziele abzielen (z. B. leitende Angestellte/Fhrungskrfte).'),(6,5,3,'Der Angreifer platziert Wechseldatentrger (z. B. Flash-Laufwerke), auf denen Malware platziert wurde, an Orten inner- oder auerhalb der physischen Umgebung des Unternehmens, an denen die Mitarbeiter die Datentrger wahrscheinlich finden (z. B. in Konferenzen, an den Arbeitspltzen der Mitarbeiter) und auf den Informationssystemen des Unternehmens verwenden.'),(8,2,5,'Der Angreifer erlangt Zugang zum Social-Media-Account des Opfers und nutzt ihn vor bsartige Zwecke.'),(18,14,13,'tbd'),(19,15,14,'tbd'),(20,16,15,'Diese Art von Bedrohung kann verschiedene Formen annehmen. Ein Mitarbeiter knnte versehentlich sensible Daten an falsche Empfnger senden, beispielsweise durch einen Fehler bei der Adressierung einer E-Mail oder durch die Auswahl eines falschen Empfngers in einer Datenbank. Eine andere Mglichkeit ist der mutwillige Diebstahl oder die Weitergabe vertraulicher Informationen durch einen Mitarbeiter, sei es aus finanziellen Motiven, Rache, Nachlssigkeit oder Unwissenheit ber die Bedeutung der Daten.'),(21,21,16,'Der Bedrohungsvektor \"Ausnutzung von Schwachstellen in internen Informationssystemen\" bezieht sich auf Angriffe, die gezielt Schwchen in den internen IT-Systemen einer Organisation ausnutzen, insbesondere in solchen, die kritische Funktionen wie Buchhaltung ausfhren. Angreifer knnten dabei Schwachstellen wie veraltete Software, unzureichend gesicherte Netzwerke oder menschliche Fehler ausnutzen.'),(22,16,34,'Der Bedrohungsvektor \"Weitergabe sensibler Informationen durch Mitarbeiter*innen\" umfasst das Risiko, dass interne Informationen durch das Handeln von Mitarbeitern unbeabsichtigt oder absichtlich auerhalb der Organisation geteilt werden. Dies kann durch direkte Weitergabe von Daten, unzureichend gesicherte Kommunikationskanle oder durch den Verlust von Datentrgern und Endgerten geschehen.'),(23,16,1,'Dieser Bedrohungsvektor beschreibt Social Engineering-Angriffe auf Mitarbeiter*innen, bei denen Angreifer psychologische Manipulation anwenden, um vertrauliche Informationen zu erhalten oder Sicherheitsbarrieren zu umgehen. Dies kann zu unberechtigtem Zugang zu sensiblen Daten oder Systemen und der Gefhrdung der gesamten IT-Sicherheit fhren.'),(25,9,17,'Der Angreifer versucht, sich durch zuflliges oder systematisches Erraten von Passwrtern Zugang zu den Informationssystemen eines Unternehmens zu verschaffen, mglicherweise mit Hilfe von Programmen zum Knacken von Passwrtern.'),(26,9,10,'Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(27,3,36,'Der Angreifer nutzt komplexere bermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum bermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(28,3,37,'Der Angreifer installiert Malware, die speziell darauf ausgelegt ist, die Kontrolle ber die internen Informationssysteme eines Unternehmens zu bernehmen, vertrauliche Informationen zu identifizieren und diese Informationen zu exfiltrieren.'),(29,18,10,'Hierbei nutzt der Angreifer bislang unbekannte Schwachstellen in Informationssystemen aus, um Zugriff zu erlangen, ohne dass es ein spezifisches Ziel oder eine bestimmte Absicht gibt.'),(30,9,38,'Beschdigung bzw. beralterung einer Reihe von Laufwerken, die alle zur gleichen Zeit vom gleichen Anbieter erworben wurden.'),(31,9,25,'Ein Angreifer versucht, eine ber das Internet zugngliche Ressource fr die beabsichtigten Benutzer unzugnglich zu machen oder zu verhindern, dass die Ressource effizient oder berhaupt funktioniert, vorbergehend oder auf unbestimmte Zeit.'),(32,6,17,'Der Angreifer versucht, sich durch zuflliges oder systematisches Erraten von Passwrtern Zugang zu den Informationssystemen eines Unternehmens zu verschaffen, mglicherweise mit Hilfe von Programmen zum Knacken von Passwrtern.'),(33,19,36,'Der Angreifer nutzt komplexere bermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum bermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen. In diesem Fall tut er dies ber den Internet-Browser, zum Beispiel ber eine geflschte Wbesite.'),(34,3,3,'Der Angreifer nutzt gngige bermittlungsmechanismen (z. B. E-Mail), um Malware in Informationssysteme von Unternehmen zu installieren/einzuschleusen.'),(35,5,7,'Der Angreifer verteilt Wechseldatenspeicher mit Malware, die das Opfer an eigenen Gerten nutzt.'),(37,2,2,'Dieser Bedrohungsvektor beschreibt Phishing-Angriffe auf Social-Media-Systeme, bei denen Angreifer geflschte Nachrichten oder Websites nutzen, um Zugangsdaten oder sensible Informationen von Mitarbeiter*innen zu stehlen. Dies kann zu unautorisiertem Zugriff auf Unternehmens- oder persnliche Konten und zur Verbreitung weiterer schdlicher Inhalte fhren.'),(38,4,2,'Phishing ist der Versand geflschter E-Mails, die Menschen dazu verleiten sollen, auf einen Betrug hereinzufallen. Phishing-Mails zielen hufig darauf ab, dass die Nutzer Finanzinformationen, Zugangsdaten oder andere sensible Daten preisgeben. In diesem Fall findet der Angriff ber einen Instant-Messenger statt.'),(39,5,31,'Beschdigung des Speichers aufgrund eines Festplattenfehlers/Mehrere Festplattenfehler aufgrund der Alterung einer Reihe von Gerten, die mglicherweise alle zur gleichen Zeit vom gleichen Anbieter erworben wurden.'),(40,4,3,'Der Angreifer nutzt gngige bermittlungsmechanismen (z. B. E-Mail), um Malware in Informationssysteme von Unternehmen zu installieren/einzuschleusen.'),(41,4,36,'Der Angreifer nutzt komplexere bermittlungsmechanismen als E-Mail (z. B. Internetverkehr, Instant Messaging, FTP), zum bermitteln von (modifizierter) Malware, um sich so Zugang zu internen Informationssystemen des Unternehmens zu verschaffen.'),(42,4,37,'Der Angreifer installiert Malware, die speziell darauf ausgelegt ist, die Kontrolle ber die internen Informationssysteme eines Unternehmens zu bernehmen, vertrauliche Informationen zu identifizieren und diese Informationen zu exfiltrieren und verwendet dazu als Einfallstor einen Instant-Messenger..'),(43,20,26,'Der Angreifer installiert Malware auf Unternehmenstelefonen, whrend sich diese Gerte auerhalb des Unternehmens befinden, um anschlieend das Unternehmen zu infizieren, wenn es wieder an Unternehmensnetzwerke angeschlossen wird.'),(44,4,1,'Beim Social Engineering nutzt der Tter den \"Faktor Mensch\" als vermeintlich schwchstes Glied der Sicherheitskette aus, um seine kriminelle Absicht zu verwirklichen. Als Einfallstor kann hierfr der Instant-Messenger genutzt werden.'),(45,3,1,'Beim Social Engineering nutzt der Tter den \"Faktor Mensch\" als vermeintlich schwchstes Glied der Sicherheitskette aus, um seine kriminelle Absicht zu verwirklichen.'),(47,16,39,'Dieser Bedrohungsvektor beschreibt die mangelhafte Absicherung von Zugriffsrechten auf sensible Systeme und Daten. Dies kann zu unberechtigtem Zugriff, Dat