INSERT INTO `trainings_trainingcategory` VALUES (1,'Social Engineering','Beim Social Engineering wird gezielt der Mensch durch eine Tuschung der Identitt und Absicht der Tter*innen ausgetrickst, um meist an sensible Daten zu gelangen oder Schadsoftware einzuschleusen. Social Engineering umfasst verschiedene Ttigkeiten, dessen Ziel es ist, den Menschen so zu manipulieren, dass Zugriffe erlaubt werden, Daten geteilt werden, Informationen preisgegeben werden oder Geldsummen gezahlt werden.\r\n\r\nIn einem ITS-Trainingsmodul sollten Ihre Mitarbeiter*innen lernen, was Social Engineering ist, wie sie sich richtig im Umgang mit Social Engineering verhalten und welche weiteren Manahmen ergriffen werden knnen.\r\n\r\nReferenzen:\r\n\r\nBSI. (2024c). Social Engineering  der Mensch als Schwachstelle. Bundesamt fr Sicherheit in der Informationstechnik. https://www.bsi.bund.de/DE/Themen/Verbraucherinnen-und-Verbraucher/Cyber-Sicherheitslage/Methoden-der-Cyber-Kriminalitaet/Social-Engineering/social_engineering.html?nn=132176'),(2,'Informationsweitergabe','Unternehmen weisen kritische und schtzende Daten und Informationen auf. Nicht immer muss die Weitergabe sensibler Informationen durch einen bswilligen Angreifer ausgelst werden. Wenn diese sensiblen Informationen beabsichtigt oder versehentlich an die ffentlichkeit durch eine interne Quelle gelangen, spricht man von einem Data Leak (ENISA, 2023). Laut dem US-amerikanischen National Institute of Standards and Technology handelt es sich bei der Informationsweitergabe, um einen Sicherheitsvorfall, der zur bertragung von klassifizierten Informationen auf ein Informationssystem fhrt, das nicht zur Speicherung oder Verarbeitung dieser Informationen befugt ist (NIST Computer Resource Center, 2024b). Eine fahrlssige Weitergabe von Informationen kann zum Beispiel durch menschliches Fehlverhalten und Miskonfigurationen entstehen (ENISA, 2023). \r\n\r\n\r\nIn diesem Trainingsmodul sollten Ihre Mitarbeiterinnen und Mitarbeiter lernen, welche Konsequenzen durch einen falschen Umgang mit sensiblen und kritischen Informationen mglich sind, wie sie sich richtig verhalten und welche weiteren Manahmen ergriffen werden knnen.\r\n\r\nReferenzen:\r\n\r\nENISA. (2023). ENISA threat landscape 2023. Publications Office. https://data.europa.eu/doi/10.2824/782573\r\nNIST Computer Resource Center. (2024b). spillageGlossary | CSRC. https://csrc.nist.gov/glossary/term/spillage'),(3,'Umgang mit Malware','Malware bedeutet so viel wie Malicious Software, auf deutsch Schadsoftware. Malware wird hufig eingesetzt, um schdliche Funktionen in einem IT-System auszufhren. Der Angriff kann beispielsweise auf ein klassisches IT-System, wie Server oder Betriebssysteme, mobile Endgerte, wie Smartphones, Netzwerkgerte, wie Router oder Industriesteueranlagen erfolgen (BSI, 2024b). \r\nDie Verbreitung der Malware kann ber unterschiedliche Wege erfolgen. Beispielsweise ber geflschte E-Mails und manipulierte Websites, durch die Manipulation von Nutzer*innen, zur manuellen Installation der Schadsoftware oder durch infizierte Installationsprogramme oder Datentrger (BSI, 2024b).  \r\nHufig erfolgt das Verbreiten von Malware in Kombination mit einem Social-Engineering Angriff.\r\n\r\nIn diesem Trainingsmodul sollten Ihre Mitarbeiterinnen und Mitarbeiter lernen, was Malware ist, wie sie sich richtig im Umgang mit Malware-Attacken verhalten und welche weiteren Manahmen ergriffen werden knnen.\r\n\r\nReferenzen:\r\n\r\nBSI. (2024b). Malware. Bundesamt fr Sicherheit in der Informationstechnik. https://www.bsi.bund.de/DE/Themen/Unternehmen-und-Organisationen/Informationen-und-Empfehlungen/Empfehlungen-nach-Gefaehrdungen/Malware/malware.html?nn=522742'),(4,'Hardware und Berechtigungen','Angreifer*innen knnen Hardware modifizieren oder durch vernderte bzw. fehlerhafte Hardware ersetzen. Dadurch knnen kritische organisatorische Strukturen kompromittiert werden.  (Blank & Gallagher, 2012).  \r\nZustzlich kann ein fehlerhaftes Berechtigungsmanagement innerhalb von Organisationen zu Sicherheitsrisiken fhren. Benutzer*innen verfgen ber zu hohe Privilegien oder Berechtigungen oder die Sicherheitsanforderungen fr den Zugriff auf eine Ressource sind zu niedrig angesetzt, wodurch es zu Sicherheitsrisiken kommen kann, da Benutzende Zugriff auf Funktionen oder Daten erhalten, die sie nicht fr die Arbeit bentigen oder fr die sie nicht autorisiert sind (BSI, 2021). \r\n\r\nIn diesem Trainingsmodul sollten Ihre Mitarbeiterinnen und Mitarbeiter lernen, woran sie fehlerhafte Hardware und zugeteilte Berechtigungen erkennen knnen, und wie sie sich richtig in diesen Situationen verhalten und welche weiteren Manahmen ergriffen werden knnen.\r\n\r\nReferenzen:\r\n\r\nBlank, R. M., & Gallagher, P. D. (2012). Guide for Conducting Risk Assessments. https://doi.org/10.6028/NIST.SP.800-30r1\r\n\r\nBSI. (2021). ORP.4 Identitts- und Berechtigungsmanagement. 8. https://www.bsi.bund.de/SharedDocs/Downloads/DE/BSI/Grundschutz/Kompendium_Einzel_PDFs_2021/02_ORP_Organisation_und_Personal/ORP_4_Identitaets_und_Berechtigungsmanagement_Editon_2021.pdf?__blob=publicationFile&v=2'),(5,'Schwachstellenausnutzung','Es kann verschiedene Schwachstellen in der Software oder Hardware bei Unternehmen geben, die anschlieend von Angreifer*innen ausgenutzt werden knnen (ENISA, 2015). Zero-Day-Angriffe stellen zum Beispiel eine Art der Schwachstellenausnutzung dar. Dabei werden von Angreifer*innen bisher unbekannte Schwachstellen im System ausgenutzt, wodurch Angreifende Zugriff auf die Organisation erhalten (Blank & Gallagher, 2012). \r\n\r\nIn diesem Trainingsmodul sollten Ihre Mitarbeiterinnen und Mitarbeiter lernen, woran sie potenzielle Schwachstellen in Informationssystemen und Angriffe auf diese erkennen knnen, und wie sie sich richtig in diesen Situationen verhalten und welche weiteren Manahmen ergriffen werden knnen.\r\n\r\nReferenzen:\r\n\r\nBlank, R. M., & Gallagher, P. D. (2012). Guide for Conducting Risk Assessments. https://doi.org/10.6028/NIST.SP.800-30r1\r\n\r\nENISA. (2015). Good practice guide on vulnerability disclosure: From challenges to recommendations. Publications Office. https://data.europa.eu/doi/10.2824/610384'),(6,'Denial-of-Service','Denial of Service (DoS) steht fr Verweigerung des Dienstes. Bei einem DoS-Angriff wird ein Server mit sehr vielen Anfragen gezielt berhuft, sodass die Anfragen nicht mehr bearbeitet werden knnen und der Dienst verweigert wird bzw. im schlimmsten Fall das System zum Erliegen kommt. Es gibt verschiedene Arten eines DoS-Angriffs: Zum einen knnen sehr viele Anfragen geschickt werden, sodass die Netzwerkverbindung berlastet oder blockiert ist fr weitere Anfragen. Zum anderen knnen groe oder fehlerhafte Datenpakete geschickt werden. Verteilte DoS-Angriffe (DDoS) stellen eine besonders wirksame Art eines Angriffs dar. Dabei greifen eine groe Anzahl von Rechnern, anstelle eines Einzelnen, gleichzeitig an, um das Ziel zu berlasten (BSI, 2024a).\r\n\r\nIn diesem Trainingsmodul sollten Ihre Mitarbeiterinnen und Mitarbeiter lernen, woran sie DoS und DDoS-Attacken erkennen knnen, und wie sie sich richtig in diesen Situationen verhalten und welche weiteren Manahmen ergriffen werden knnen.\r\n\r\nReferenzen:\r\n\r\nBSI. (2024a). DoS- und DDoS-Attacken. Bundesamt fr Sicherheit in der Informationstechnik. https://www.bsi.bund.de/DE/Themen/Verbraucherinnen-und-Verbraucher/Cyber-Sicherheitslage/Methoden-der-Cyber-Kriminalitaet/DoS-Denial-of-Service/dos-denial-of-service.html?nn=132356'),(7,'Passwortmanagement','Zum Schutz vor Passworterratungs-Angriffen legt das BSI verschiedene Regelungen fr den Passwortgebrauch vor (BSI, 2021). Bei Brute-Force-Angriffen versuchen Tter*innen ein Passwort durch Ausprobieren herauszufinden. Dafr gehen Hacker*innen alle mglichen Kombinationen durch, mit der Hoffnung, dass richtige Passwort zu erraten (NIST Computer Resource Center, 2024a).\r\n\r\nIn diesem Trainingsmodul sollten demnach Ihre Mitarbeiterinnen und Mitarbeiter lernen, wie sie sichere Passwrter erstellen, mit diesen umgehen und wie sie sich richtig in diesen Situationen verhalten, wenn ein Passwort komprimiert wird.\r\n\r\nReferenzen:\r\n\r\nBSI. (2021). ORP.4 Identitts- und Berechtigungsmanagement. 8. https://www.bsi.bund.de/SharedDocs/Downloads/DE/BSI/Grundschutz/Kompendium_Einzel_PDFs_2021/02_ORP_Organisation_und_Personal/ORP_4_Identitaets_und_Berechtigungsmanagement_Editon_2021.pdf?__blob=publicationFile&v=2\r\n\r\nNIST Computer Resource Center. (2024a). Brute Force Password AttackGlossary | CSRC. https://csrc.nist.gov/glossary/term/brute_force_password_attack');
